/*
    本文件为应用的入口文件
*/
import React from 'react'
import ReactDOM from 'react-dom'
import App from './App'
import store from './redux/store'


ReactDOM.render(
    <App />, document.getElementById('root')
)

//检测redux中状态的改变，如redux的状态发生了改变，就重新渲染App组件
store.subscribe(() => {
    ReactDOM.render(
        <App />,
        document.getElementById('root')
    )
})
